import React from 'react';
import store from "../../redux/state";
import classes from './Header2.module.css';
import {NavLink} from "react-router-dom";

const Header2 = () => {
    return(
        <header className={classes.header}>
         
            <div><b><h3>Привет {store._state.ProfileInfo[0].Firstname}!</h3></b>
            <div><NavLink className={classes.item} activeClassName={classes.activeLink} to='/Photos'>Мои фото</NavLink></div>
            </div>


      </header>
    )
}

export default Header2;
